export const handlePlaces = (places) => {
  return {
    type: 'PLACES',
    payload: places,
  };
};

export const toggleVisited = () => {
  return {
    type: 'VISITED',
  };
};


export const fetchPlaces = () => {
  try {
    return places.historical_places;

  } catch (error) {
    console.error('Error fetching places:', error);
    return [];
  }
};

export const fetchPlaceById = (id) => {
  try {
    return places.historical_places.find((place) => place.id == id);
  } catch (error) {
    console.error(`Error fetching place with id ${id}:`, error);
    return null;
  }
};
